commits.content:
.nav {
display: block;

&__wr {
  display: flex;
  padding: 0 50px;
  justify-content: space-between;
  align-items: center;
  max-width: 100%;
}

&__logo {
  align-self: center;
  justify-content: center;
  height: 40px;
  width: 40px;
  display: block;
}

&__list {
  display: flex;
  justify-content: space-between;
  list-style: none;
  margin: 0;
  padding: 0;
}

&__item {
  display: list-item;
  margin-left: 20px;
  text-transform: uppercase;
}

&__link {
  display: flex;
  align-items: center;
  text-decoration: none;
  color: #060b35;
  height: 60px;
  font-size: 12px;

  &:hover {
  color: #00ACDC;
}
}
}
